import React from 'react';
import './TransactionCard.css';

const TransactionCard = ({ title, amount, type, client, date }) => (
  <div className={`transaction-card ${type}`}>
    <div className="transaction-title">{title}</div>
    <div className="transaction-details">
      <span className="transaction-amount">{amount}</span>
      <span className="transaction-type">{type === 'income' ? 'تحويل بنكي' : type === 'expense' ? 'نقد' : 'فاتورة إلكترونية'}</span>
    </div>
    <div className="transaction-client">{client}</div>
    <div className="transaction-date">{date}</div>
  </div>
);

export default TransactionCard;
